import React from 'react';
import {Link} from "react-router-dom";

const Post = ({post}) => {

    const {id,title} = post;

    return (
        <div>
            {id}) {title} <Link to={`${id}`} state={post}>Details Post </Link>
        </div>
    );
};

export {Post};
